import { useField } from 'formik';

const FormField  = ({ name, id, ...restProps }) => {
    const [field, meta, helpers] = useField({ name, id, ...restProps })
    return (
        <div>
        <input {...field} name={name} id={id ?? name }  />
        </div>
    )
}

export default FormField;
